import React from 'react';
import ReactDOM  from 'react-dom';
const Quiz=(props)=>
{
    let x=props.x;
    let y=props.y;
    let z=props.z;
    
   return(
       <div>
            ((x===y)&&(y==z))?<><h1>{x} {y} {z} <br/>Matched</h1> <hr /></>:<><h1>{x} {y} {z} <br/>Not Matched</h1> <hr /></>
        </div>   
   );
  
}
export default Quiz;
